import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
  name: 'dateTimeFormatPipe'
})
export class DateTimeFormatPipe implements PipeTransform {

  transform(value: unknown, ...args: unknown[]): unknown {
    return super.transform(value,);
  }

}
